def calculate_total_cost(shopping_list):
    """"""
    total_cost = 0
    num_excluded = 0
    for item in shopping_list:
        if item['price'] <= 10:
            total_cost += item['price']
        else:
            num_excluded += 1
    total_cost = int(total_cost * 100 + 0.5) / 100
    print('Number of excluded items: ' + str(num_excluded))
    return '$' + str(total_cost)
